option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

enum CompressionType {
	COMPRESSION_TYPE_UNKNOWN = 0;
	COMPRESSION_TYPE_GZIP = 1;
	COMPRESSION_TYPE_BROTLI = 2;
}
